import React from 'react';
import { ManagementToolNav, VirtualWarehouseTable } from '../../../common/components'

import Button from 'react-bootstrap/Button';

function VirtualWarehouseTemplate(props) {
    const { items, isOwner, tableStore, navigateDashboard } = props.viewStore;
    debugger
    tableStore.items = items;
    tableStore.isOwner = isOwner;
    return (
        <div>
            <ManagementToolNav />
            <h1>Virtual warehouse</h1>
            <Button variant="btn btn-secondary" onClick={navigateDashboard}>Back</Button>
            <VirtualWarehouseTable store={tableStore} />
        </div>
    )
}

export default VirtualWarehouseTemplate;
